import React from "react";

type Props = {
    title: string
    desc: string
    image: string
}

const ClientBox: React.FC<Props> = ({title, desc, image}) => {
    return <div className="client-box">
        <img src={ image } width="80px" height="80px" />
        <h4>{title}</h4>
        <p>
            {desc}
        </p>
    </div>
}

export default ClientBox;
